import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {

  let name = 'France';
  name = 'Celynne';
  let profile =
  [
    {
      name: 'France',
      age: 23,
    },
    {
      name: 'Celynne',
      age: 22,
    }
    ];

      const arr = [1,2,3,4,5]
  return (

    <div className="App">
      <Header />
      <main>
        <h1>Hello, I'm {profile.name} {profile.age} years old {profile.null}</h1>
        <p></p>
        {profile.map((p => <li> {p.name} </li>))}

      </main>
      <Footer />

    </div>
  );
}

export default App;
